let shirtimg="https://assets.myntassets.com/h_1440,q_100,w_1080/v1/assets/images/1862801/2018/2/9/11518155061506-Roadster-Men-Maroon--Navy-Blue-Regular-Fit-Checked-Casual-Shirt-8861518155061131-1.jpg"

function Catagory() {
    const cat=[
        {
            title:"Shirt",
            imgurl:shirtimg
        },
        {
            title:"Pants"
        },
        {
            title:"Coat"
        },
        {
            title:"Shoes"
        },
        {
            title:"T-shirt"
        }
    ]
    return (
        <div className="App">
             <div className="catagories">
                {cat.map((catagories)=>(
                    <div className="catagory-container">
                        <div className="catagory-body"> 
                            <h2>{catagories.title} </h2>
                            <button className="button">Shop Now</button>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    )
}
export default Catagory
